function matchWanderlogLocationId(cityName) {
  let match = WANDERLOG_LOCATIONS.find(location=>location.name===cityName);
  if (!match){
    match = WANDERLOG_LOCATIONS.find(location=>location.name.includes(cityName));
  }

  return match?.id || 0;
}
